import { BrowserRouter, Routes, Route } from "react-router-dom";
import { useState } from "react";

import Login from './Pages/Login';
import Newuser from "./Pages/Newuser";
import Forgot from "./Pages/Forgot";
import UserDashboard from "./Pages/UserDashboard";
import ViewRequest from "./Pages/ViewRequest";
import RaiseRequest from "./Pages/RaiseRequest";
import AdminDashboard from "./Pages/AdminDashboard";
import ManageUsers from "./Pages/ManageUsers";
import ManageServices from "./Pages/ManageServices";
import ManageRequests from "./Pages/ManageRequest";
import RequestDetail from "./Pages/RequestDetail";

function App() {
  const [requests, setRequests] = useState([]);

  const addRequest = (newRequest) => {
    setRequests((prev) => [...prev, newRequest]);
  const sampleRequest = {
    user: 'John Doe',
    service: 'Plumbing',
    description: 'Leak in kitchen',
    status: 'Pending'
  };

  const handleStatusUpdate = (newStatus) => {
    console.log("Status updated to:", newStatus);
  };
}

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/newuser" element={<Newuser />} />
        <Route path="/forgot" element={<Forgot />} />
        <Route path="/userdashboard" element={<UserDashboard />} />
        <Route path="/raiserequest" element={<RaiseRequest addRequest={addRequest} />} />
        <Route path="/viewrequest" element={<ViewRequest requests={requests} />} />
        <Route path="/admindashboard" element={<AdminDashboard />} />
        <Route path="/manageusers" element={<ManageUsers/>} />
        <Route path="/manageservices" element={<ManageServices />} />
        <Route path="/managerequests" element={<ManageRequests />} />
        <Route path="/requestdeta"element={<RequestDetail request={sampleRequest} onUpdate={handleStatusUpdate} />}
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
